import React, { useState } from "react";
import PropTypes from "prop-types";
import { useRouteMatch } from "react-router-dom";

const Product = (props) => {
  let match = useRouteMatch();
  return <div>{match.url}</div>;
};

Product.propTypes = {};

export default Product;
